 * 创建Page时，需要在main_pages.json中进行注册
 */
@Entry
@Component
struct TestPage {
  @State isSwitchDataSource: boolean = false;
  @State message: string = 'Hello World'
  private context = getContext(this) as common.UIAbilityContext;

